import React from "react";
import styles from "../Dialogs/Dialogs.module.css";
import { NavLink } from "react-router-dom";

const DialogItem = () => {
    return (
        <NavLink to="/dialogs/1" className={styles.active}>
            Leo
        </NavLink>
    );
};

const Dialogs = () => {
    return (
        <div className={styles.dialogs}>
            <div className={styles.dialogsItem}>
                <div className={styles.dialog}></div>
                <div className={styles.dialog}>
                    <DialogItem name="Leo" id="1" />
                    <DialogItem name="Mark" id="2" />
                    <DialogItem name="Alf" id="3" />
                    <DialogItem name="Bean" id="4" />
                    <DialogItem name="Bill" id="5" />
                    <NavLink to="/dialogs/2" className={styles.active}>
                        Mark
                    </NavLink>
                </div>
                <div className={styles.dialog}>
                    <NavLink to="/dialogs/3" className={styles.active}>
                        Alf
                    </NavLink>
                </div>
                <div className={styles.dialog}>
                    <NavLink to="/dialogs/4" className={styles.active}>
                        Bean
                    </NavLink>
                </div>
                <div className={styles.dialog}>
                    <NavLink to="/dialogs/5" className={styles.active}>
                        Bill
                    </NavLink>
                </div>
            </div>
            <div className={styles.messages}>
                <div className={styles.message}>Hello!</div>
                <div className={styles.message}>Hi!</div>
                <div className={styles.message}>Have fun!</div>
            </div>
        </div>
    );
};

export default Dialogs;
